export function add32(a: number, b: number): number {
  return a + b;
}

export function subtract32(a: number, b: number): number {
  return a - b;
}

export function multiply32(a: number, b: number): number {
  return a * b;
}

export function divide32(a: number, b: number): number {
  return a / b;
}
